function renderRecipes(results) {
    const container = document.getElementById('recipeContainer');
    container.innerHTML = '';

    results.forEach(recipe=>{
        const recipeElement = document.createElement('section');
        recipeElement.className = 'recipe';
        recipeElement.innerHTML = `
          <h2>${recipe.title}</h2>
          <p>Category: ${recipe.category}</p>
          <p>Rating: ${recipe.rating}</p>
          <p>Preparation Time: <span id="${recipe.title}_prepTime">${recipe.prepTime}</span></p>
          <p>Cook Time: <span id="${recipe.title}_cookTime">${recipe.cookTime}</span></p>
          <p>Total Time: <span id="${recipe.title}_totalTime">${recipe.totalTime}</span></p>
         
          <button onclick="rateRecipe('${recipe.title}')">Rate</button>
          <button id="favoriteButton" onclick="toggleFavorite('${recipe.title}')">Favorite</button>
          <div id="${recipe.title}_favoriteContainer"></div>
          <button onclick="shareRecipe('${recipe.title}')">Share</button>
          <button onclick="showComments('${recipe.title}')">Comments</button>
          <div id="${recipe.title}_comments" style="display: none;"></div>
          <p>Instructions: ${recipe.instructions || 'Not available'}</p>
          ${recipe.imageSrc ? `<img src="${recipe.imageSrc}" alt="${recipe.title}" style="max-width: 100%;">` : ''}
          <p>Video Link: <a href="${recipe.videoLink}" target="_blank">Watch Video</a></p>
      `;
        container.appendChild(recipeElement);
    }
    );
}

renderRecipes(recipes);
