let isFavorite = false;

function toggleFavorite(title) {
    isFavorite = !isFavorite;
    const favoriteContainer = document.getElementById(`${title}_favoriteContainer`);

    if (isFavorite) {
        const favoriteDiv = document.createElement("div");
        favoriteDiv.innerHTML = `${title} is my favorite.`;
        favoriteContainer.appendChild(favoriteDiv);
    } else {
       
        favoriteContainer.innerHTML = '';
    }
}

function shareRecipe(title) {// To be implemented if needed
}

function showComments(title) {
    const commentsDiv = document.getElementById(`${title}_comments`);
    commentsDiv.style.display = commentsDiv.style.display === 'none' ? 'block' : 'none';
    commentsDiv.innerHTML = '';
    const recipe = recipes.find(recipe=>recipe.title === title);
    recipe.reviews.forEach(review=>{
        const commentElement = document.createElement('div');
        commentElement.innerHTML = `<p>${review.user}: ${review.comment}</p>`;
        commentsDiv.appendChild(commentElement);
    }
    );
}

function searchRecipes() {
    const searchInput = document.getElementById('searchInput').value.toLowerCase();
    const results = recipes.filter(recipe=>recipe.title.toLowerCase().includes(searchInput));
    renderRecipes(results);
}

function filterByCategory(category) {
    const results = category === 'All' ? recipes : recipes.filter(recipe=>recipe.category === category);
    renderRecipes(results);
}

renderRecipes(recipes);
